import { useState, useEffect } from 'react'

function App() {
  const [data, setData] = useState({username:'', role:''});
  const [home, setHome] = useState(null);

  async function handleClick(){
    // fetch("/employees")
    // .then((res) => res.json())
    // .then((data) => {setHome(data)});
    fetch('/test').then((res) => console.log(res))

  }

  useEffect(() => {
    fetch("/studentLogin")
      .then((res) => res.json())
      .then((data) => {setData({username: data.username, password: data.password, role: data.role})});
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <p>UserName: {!data ? "Loading..." : data.username}</p>
        <p>Password: {!data ? "Loading..." : data.password}</p>

        <form>
          input
          <button onClick={handleClick}>Home page</button>
        </form>


        {console.log(home)}
      </header>
    </div>
  );
}

export default App;
